import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { fetchAuthenticate, fetchMovies } from "../../DataSystem/Redux/asyncActions";



const Home = () => {
    
    


    return (
        <div>
            <h1>Home</h1>
            <button onClick={() => state.dispatch(fetchAuthenticate())}>Get Authenticate</button>
            <button onClick={() => state.dispatch(fetchMovies())}>Get Movies</button>
        </div>
    )
}

export default Home
